import ReactDOM from "react-dom";
import im1 from "./1.jpeg";
import im2 from "./2.jpeg";
import im3 from "./3.jpeg";
import im4 from "./4.webp";
import im5 from "./5.webp";
import im6 from "./6.png";
import im7 from "./7.jpeg";
import im8 from "./8.jpeg";
import im9 from "./9.jpeg";
import im10 from "./10.jpeg";
import im11 from "./11.jpeg";
import im12 from "./12.jpeg";
import im13 from "./13.webp";
import im14 from "./14.jpeg";
import im15 from "./15.jpeg";
import im16 from "./16.webp";
import im17 from "./17.webp";
import im18 from "./18.jpeg";
import im19 from "./19.webp";
import im20 from "./20.webp";
import im21 from "./21.jpeg";
import im22 from "./22.jpeg";
import "./index.css";
import React from "react";
import { render } from "@testing-library/react";
//import { test } from "./cart.js";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.item1 = "Samosa";
    this.price1 = 15;
    this.aval1 = "Yes";
    this.item2 = "Veg Puff";
    this.price2 = 25;
    this.aval2 = "Yes";
    this.item3 = "Litchi";
    this.price3 = 20;
    this.aval3 = "Yes";
    this.item4 = "Kurkure";
    this.price4 = 20;
    this.aval4 = "Yes";
    this.item5 = "Lays";
    this.price5 = 20;
    this.aval5 = "Yes";
    this.item6 = "Masala Puri";
    this.price6 = 60;
    this.aval6 = "Yes";
    this.item7 = "Pani Puri";
    this.price7 = 60;
    this.aval7 = "Yes";
    this.item8 = "Samosa Masala";
    this.price8 = 60;
    this.aval8 = "Yes";
    this.item9 = "Bhel Puri";
    this.price9 = 60;
    this.aval9 = "Yes";
    this.item10 = "Paneer S/W";
    this.price10 = 40;
    this.aval10 = "Yes";
    this.item11 = "Corn S/W";
    this.price11 = 40;
    this.aval11 = "Yes";
    this.item12 = "Mojito";
    this.price12 = 50;
    this.aval12 = "Yes";
    this.item13 = "Dairy Milk Silk";
    this.price13 = 80;
    this.aval13 = "Yes";
    this.item14 = "Gone Mad";
    this.price14 = 5;
    this.aval14 = "Yes";
    this.item15 = "Maggi";
    this.price15 = 30;
    this.aval15 = "Yes";
    this.item16 = "Coffee";
    this.price16 = 10;
    this.aval16 = "Yes";
    this.item17 = "Tea";
    this.price17 = 10;
    this.aval17 = "Yes";
    this.item18 = "Coke";
    this.price18 = 40;
    this.aval18 = "Yes";
    this.item6 = "Raspberry Ripple";
    this.price19 = 40;
    this.aval19 = "Yes";
    this.item20 = "Cornetto";
    this.price20 = 60;
    this.aval20 = "Yes";
    this.state = {
      order: [],
      total: 0,
    };

    this.test = this.test.bind(this);
  }
  test = (value, price) => {
    document.getElementById(
      "cart"
    ).innerHTML += `<div id="each"> ${value}</div> <br />`;

    let tot = this.state.total + price;
    //this.setState({total:tot});
    let str = "Item:" + value + "," + "Price:" + price;
    let arr = this.state.order;
    arr.push(str);
    this.setState({ total: tot, order: arr });
    console.log(this.state.total);
    document.getElementById("tot").innerHTML = `Total: â‚¹${tot}`;
  };

  sendData = () => {
    let custname = document.getElementById("custname").value;
    let ph = document.getElementById("custph").value;
    const formInfo = {
      Name: custname,
      Phone: ph,
      Orders: this.state.order,
      Total: this.state.total,
    };
    alert("Submitted!!");
    this.setState({ total: 0, order: [] });
    fetch("http://localhost:3001/", {
      method: "POST",
      cache: "no-cache",
      headers: {
        "Content-type": "application/json; charset=UTF-8",
      },
      body: JSON.stringify(formInfo),
    })
      .then((res, err) => {
        if (err) {
          throw err;
        }
        return res.text();
      })
      .then((text) => alert(text))
      .catch()


    console.log('res sent')
  };

  render() {
    return (
      <html lang="en">
        <head>
          <meta charset="UTF-8" />
          <meta http-equiv="X-UA-Compatible" content="IE=edge" />
          <meta
            name="viewport"
            content="width=device-width, initial-scale=1.0"
          />
          <link rel="stylesheet" href="css1.css" />
